import React from "react";

const ItemsList = () => {
  return(
    <div className="ui relaxed divided list">
      <div className="item">
        <i className="item-icon" />
        <div className="content">
          Some text
        </div>
      </div>
      <div className="item">
        <div className="content">
          Some text
        </div>
      </div>
    </div>
  );
}

export default ItemsList;
